import React, { useEffect, useState } from "react";
import Table from "./Table";

const AdminHome = (userData) => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5050/getAllUser", {
      method: "GET",
    })
      .then((res) => res.json())
      .then((data) => {
        console.log(data, "userData");
        setData(data.data);
      });
  }, []);
  const logout = () => {
    window.localStorage.clear();
    window.location.href = "./";
  };
  return (
    <div>
      <div className="bg-zinc-400 h-screen flex justify-center items-center">
        <div className="bg-white rounded-lg shadow-black/30 border-solid border-2 border-black  pl-10 space-y-3  flex flex-col justify-center overflow-y-auto">
          {data.map((i) => {
            return <Table data={data} />;
          })}

          <button
            onClick={logout}
            className="flex justify-center items-center bg-slate-900 w-20 h-7 text-white rounded-full mb-2 ml-2"
          >
            Log Out
          </button>
        </div>
      </div>
    </div>
  );
};

export default AdminHome;
